const meta = {
    title: 'Views/EventsView/ViewButtons',
    component: ViewButtonsComponent,
    tags: ['autodocs'],
    decorators: [moduleMetadata({
            imports: [ToggleButtonModule]
        })],
    argTypes: {
        wrapperClassNames: { description: 'Custom CSS classes as component wraps' },
        classNames: { description: 'Custom CSS classes' },
        action: { description: 'Action click event sent to the parent component' }
    },
    parameters: {
        docs: {
            description: {
                component: `Component that groups [PrimeNg Button](https://primeng.org/button) into an options toolbar that emit 
							the specific event action into the parent component.<br><br>
							• **[wrapperClassNames]** string data used for put CSS classes on the component tag element<br>
							• **[classNames]** string data used for put CSS classes to extend the default CSS compoenent class<br>
							• **(action)** object data **{ type:string, value: any }** as event value emitted into the parent component`,
            }
        }
    },
};
export default meta;
export const _ViewButtonsComponent = {
    args: {
        wrapperClassNames: '',
        classNames: ''
    }
};
